INSERT INTO `post` VALUES (36,'Semester Opening Party','Die legendäre Eröffnungsparty des Sommersemesters – mit DJ, Getränkespecials und guter Stimmung!',25,49,1,'2025-09-15 21:00:00','2025-09-15 23:59:00'),(37,'Open-Air Kinoabend','Wir zeigen \"Interstellar\" unter freiem Himmel. Decken & Snacks mitbringen!',26,50,1,'2025-08-22 18:00:00','2025-08-22 21:30:00'),(38,'Escape Room Challenge','Trete mit deinem Team gegen andere DHBW-Teams an. Wer löst das Rätsel am schnellsten?',27,51,1,'2025-10-10 18:00:00','2025-10-10 21:00:00'),(39,'Yoga im Park','Kostenloser Yoga-Kurs für Studierende – keine Vorkenntnisse nötig.',25,52,1,'2025-07-08 18:00:00','2025-07-08 19:00:00'),(40,'Paint & Sip – Malen mit Wein','Kreativabend mit Acrylfarben, Leinwand & einem Glas Wein. Vorkenntnisse nicht erforderlich!',28,53,2,'2025-09-18 19:00:00','2025-09-18 22:00:00'),(41,'Bowling Night','Lustige Runde Bowling für DHBW-Studis – 50% Rabatt mit Studierendenausweis!',29,54,2,'2025-08-12 20:00:00','2025-08-12 23:00:00'),(42,'Mic & Poetry Slam','Bühne frei für deine Stimme – Slam, Musik, Comedy.',25,55,5,'2025-07-26 19:00:00','2025-07-26 23:30:00'),(43,' Klettern für Einsteiger','Einführung ins Bouldern mit Trainer*in – Leihschuhe inklusive. In der Bouderhalle Blockhaus',30,56,7,'2025-07-14 18:00:00','2025-07-14 21:00:00'),(44,'International Dinner',' Jeder bringt ein landestypisches Gericht mit – Essen, Kultur und neue Leute kennenlernen!  Treffpunkt direkt an der DHBW Ravensburg',31,58,8,'2025-07-24 18:00:00','2025-07-24 22:30:00'),(45,' Spieleabend mit Brett- und Kartenspiele','Von Uno bis Codenames – bring dein Lieblingsspiel mit oder leih dir eins vor Ort!',27,60,9,'2025-07-23 20:00:00','2025-07-23 23:00:00'),(46,'City Bike Tour & Eis','Entdecke deine Studienstadt mit dem Fahrrad – inklusive Pause beim besten Eisladen der Stadt.',25,62,10,'2025-08-07 13:15:00','2025-08-07 13:15:00');
